import React from "react";

export default function Card(){
  return(
    <div className="card">
      <img src="./images/image12.png" className="card-image"/>
      <div className="sold">SOLD OUT</div>
      
      <img src="./images/star 1.png" width={14}/> 5.0 <span className="six">(6).USA</span>
      
      <p className="life">
        Life lessons with Katie Zaferes
      </p>
      <p>
        <span className="from">From $136</span> / person
      </p>

    </div>
  )

}
